import React from "react";
import "./header.css";

function Header() {
  return (
    <div className="header">
      <div className="logo"><p>fenomenden.com</p></div>
      <div className="search">SEARCH</div>
      <div className="menu">
        <ul>
          <li>GİRİŞ YAP</li>
          <li>İLAN VER</li>
        </ul>
      </div>
    </div>
  );
}

export default Header;
